import styled from 'styled-components';

export const LeftSideBarWrap = styled.div`
  border-right: 1px solid #ccc;
  height: 100vh;
  .ant-menu-item {
    padding: 10px;
    a {
      display: flex;
      align-items: center;
      text-decoration: none;
      color: black;
      i {
        margin-right: 5px;
      }
    }
    &:first-child {
      margin-top: 20px;
    }
  }
`;
